#3 year of salary for each employee and an increase in pay every 6 months between 1$ and 2$

#Initial Salary 2019-01-01

#Pay increase 2019-06-01
	SELECT e.idEmployee, MAX(es.hourlyRate) + FLOOR(RAND() * (3 - 1) + 1)  as hourlyRate, CAST("2019-06-01" AS DATE) as effectiveDate  
	FROM Employee e 
    INNER JOIN EmployeeSalary es on es.idEmployee = e.idEmployee GROUP BY e.idEmployee;

#Pay increase 2020-01-01
	SELECT e.idEmployee, MAX(es.hourlyRate) + FLOOR(RAND() * (3 - 1) + 1)  as hourlyRate, CAST("2020-01-01" AS DATE) as effectiveDate  
	FROM Employee e 
    INNER JOIN EmployeeSalary es on es.idEmployee = e.idEmployee GROUP BY e.idEmployee;

#Pay increase 2020-06-01
	SELECT e.idEmployee, MAX(es.hourlyRate) + FLOOR(RAND() * (3 - 1) + 1)  as hourlyRate, CAST("2020-06-01" AS DATE) as effectiveDate  
	FROM Employee e 
    INNER JOIN EmployeeSalary es on es.idEmployee = e.idEmployee GROUP BY e.idEmployee;

